import { Ionicons } from '@expo/vector-icons';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { createStackNavigator } from '@react-navigation/stack';
import * as React from 'react';
import WalletScreen from '../screens/WalletScreen';
import SendScreen from '../screens/SendScreen';
import OptionsScreen from '../screens/OptionsScreen';
import { AntDesign } from '@expo/vector-icons';

const BottomTab = createBottomTabNavigator();

export default function BottomTabNavigator() {
  return (
    <BottomTab.Navigator
      initialRouteName="Wallet">
      <BottomTab.Screen
        name="Wallet"
        component={WalletNavigator}
        options={{
          tabBarIcon: ({ color }) => <TabBarIcon name="wallet" color={color} />,
        }}
      />
    <BottomTab.Screen
        name="Send"
        component={SendNavigator}
        options={{
          tabBarIcon: ({ color }) => <TabBarIcon name="caretright" color={color} />,
        }}
      />

    <BottomTab.Screen
        name="Options"
        component={OptionsNavigator}
        options={{
          tabBarIcon: ({ color }) => <TabBarIcon name="setting" color={color} />,
        }}
      />


    </BottomTab.Navigator>
  );
}

// You can explore the built-in icon families and icons on the web at:
// https://icons.expo.fyi/
function TabBarIcon(props) {
  return <AntDesign size={30} style={{ marginBottom: -3 }} {...props} />;
}

const WalletStack = createStackNavigator();

function WalletNavigator() {
  return (
    <WalletStack.Navigator>
      <WalletStack.Screen
        name="Wallet"
        component={WalletScreen}
        options={{ headerTitle: 'Wallet' }}
      />
    </WalletStack.Navigator>
  );
}


const SendStack = createStackNavigator();

function SendNavigator() {
  return (
    <SendStack.Navigator>
      <SendStack.Screen
        name="Send"
        component={SendScreen}
        options={{ headerTitle: 'Send' }}
      />
    </SendStack.Navigator>
  );
}


const OptionsStack = createStackNavigator();

function OptionsNavigator() {
  return (
    <OptionsStack.Navigator>
      <OptionsStack.Screen
        name="Wallet"
        component={OptionsScreen}
        options={{ headerTitle: 'Options' }}
      />
    </OptionsStack.Navigator>
  );
}
